import logo from './logo.svg';
import './App.css';
import Footer from "./layout/Footer";
import Header from './layout/Header';
import Menu from './layout/Menu';

function App() {
  return (
    <div id="wrap" className="dark">
      <Header/>
      <Menu/>
      <Footer/>
    </div>
  );
}

export default App;
